css:
.git-plus .alert {
  color: #e9c062;
}
.git-plus .success {
  color: #a8ff60;
}
.git-plus .overlay.from-bottom {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #96cbfe;
}
.meta.diff.header {
  color: #96cbfe;
}
.markup.deleted.diff {
  color: #cc6666;
}
.markup.inserted.diff {
  color: #a8ff60;
}
